description:
Kriminaliteten okar och brottslingar gar fria. Hederliga medborgare 
blir gang pa gang svikna av politiker och rattsvasende. Ett gang man 
far nog, bildar ett medborgargarde och bestammer sig for att ta 
rattvisan i egna hander. Nu ska inte brottslingarna komma undan langre! 
Med Sean Bean, Danny Dyer, Lennie James och Bob Hoskins.
